import Vue from 'vue'
import Router from 'vue-router'

// Importação de componentes

import sobre_Mim from '@/components/sobreMim.vue'

Vue.use(Router)

export default new Router({
    mode: 'history',
    routes: [
        {
            path:'/sobremim',
            name:'sobremim',
            component: sobreMim
        }
    ]
})
